// nPLPro
const nPLPro = {
    bookList: [],
    currentBookIndex: -1,
    compile: function() {
        if (this.currentBookIndex !== -1) {
            const currentBook = this.bookList[this.currentBookIndex];
            let t = window.location.href.split("?")[0],
                e = currentBook.chapters.findIndex(e => e.link.split("?")[0] === t);
            if (-1 !== e) {
                let n = e + 1,
                    i = e - 1,
                    r = "",
                    l = "";
                n < currentBook.chapters.length && (r = `<a class="prevPLPro"href="${currentBook.chapters[n].link}"><span>&#8249;</span><span>Trước kia</span></a>`), i >= 0 && (l = `<a class="nextnPLPro"href="${currentBook.chapters[i].link}"><span>Kế tiếp</span><span>&#8250;</span></a>`), jQuery(".nPL-show").html(`<select onchange="location = this.value;"class="nPL_select">${currentBook.chapters.map((chapter,index)=>`<option value="${chapter.link}"${index===e?"selected":""}>${chapter.title}</option>`).join("")}</select><div class="inner_nPL">${l}${r}</div>`);
                // const head = document.querySelector("head");
                // for (let j = 0; j < currentBook.chapters.length; j++) {
                    // const prefetchLink = document.createElement("link");
                    // prefetchLink.href = currentBook.chapters[j].link;
                    // prefetchLink.rel = "prefetch";
                    // head.appendChild(prefetchLink);
                // }
            }
        }
    },
    create: function(bookLabel, e = [], startIndex = 1) {
        const maxResults = 50;
        const feedUrl = `/feeds/posts/summary/-/${bookLabel}?alt=json-in-script&start-index=${startIndex}&max-results=${maxResults}`;
        jQuery.ajax({
            type: "get",
            url: feedUrl,
            dataType: "jsonp"
        }).done(data => {
            if ("entry" in data.feed) {
                const chapters = [];
                data.feed.entry.forEach(post => {
                    const hasSeriesLabel = post.category.some(category => category.term === "Series");
                    if (!hasSeriesLabel) {
                        let link = post.link.find(item => item.rel === "alternate").href.split("?")[0];
                        chapters.push({
                            title: post.title.$t,
                            link: link
                        });
                    } else {
                        jQuery(".infoSeries").attr("href", post.link.find(item => item.rel === "alternate").href.split("?")[0]);
                    }
                });
                let bookIndex = this.bookList.findIndex(book => book.label === bookLabel);
                if (bookIndex === -1) {
                    this.bookList.push({
                        label: bookLabel,
                        chapters: chapters
                    });
                    bookIndex = this.bookList.length - 1;
                } else {
                    this.bookList[bookIndex].chapters = chapters;
                }
                if (data.feed.entry.length === maxResults) {
                    startIndex += maxResults;
                    this.create(bookLabel, e, startIndex);
                } else {
                    this.currentBookIndex = bookIndex;
                    this.compile();
                }
            } else {
                console.log("Error: no entries found.");
            }
        }).fail(error => {
            console.log(error);
        });
    },
    run: function(bookLabel, e = []) {
        "function" == typeof jQuery && document.getElementById("nPL") ? this.create(bookLabel, e) : console.log("Lỗi: không tìm thấy chức năng hoặc phần tử.")
    }
};
// Canvas
const images = [];
const canvases = [];
const canvasContainer = document.getElementById("canvas-chapter");

function getModifiedSrc(imgTag) {
  const srcRegex = /src=(["'])(.*?)\1/;
  const match = imgTag.match(srcRegex);
  if (match) {
    let src = match[2];
    src = src.replace(/s1600/, "s1600-rw");
    src = src.replace(/s1600-rw\/.*/, "s1600-rw/MSKTeam.webp");
    const domains = ['i0.wp.com', 'i1.wp.com', 'i2.wp.com', 'i3.wp.com'];
    const randomDomain = domains[Math.floor(Math.random() * domains.length)];
    const modifiedSrc = src.replace(/https?:\/\//, `https://${randomDomain}/`);
    return modifiedSrc;
  }
  return null;
}

const imgTags = imgtags.match(/<img[^>]+>/g);
const totalImages = imgTags.length;
let loadedImages = 0;

function loadNextImage() {
  if (loadedImages >= totalImages) {
    return;
  }

  const imgTag = imgTags[loadedImages];
  const src = getModifiedSrc(imgTag);

  if (src) {
    const image = new Image();
    const canvasWrapper = document.createElement("div");
    canvasWrapper.className = "canvas-wrapper";

    const canvas = document.createElement("canvas");
    canvases.push(canvas);
    canvasWrapper.appendChild(canvas);
    canvasContainer.appendChild(canvasWrapper);

    image.onload = function() {
      canvas.width = image.width;
      canvas.height = image.height;
      const ctx = canvas.getContext("2d");
      ctx.imageSmoothingEnabled = true;
      ctx.imageSmoothingQuality = "high";
      ctx.drawImage(image, 0, 0);
      
      canvasWrapper.style.maxWidth = `${image.width}px`;
      canvasWrapper.style.maxHeight = `${image.height}px`;
    };
    image.src = src;
  }

  loadedImages++;
  setTimeout(loadNextImage, 300);
}
window.addEventListener('DOMContentLoaded',function(){
 loadNextImage();
});
